reviewText:
I ordered about 600 items from Amazon in the last 6 months and have never seen such a careful packaging. This soft scarf comes so well packed and with so many extras, that I couldn't believe it. I ordered this for myself, but this would make so amazing present, that I was considering a while, if I should gift it to someone. I decided to keep it, but I would love to gift it, I can already imagine an impressed receiver when someone would see this. You get:

- Extremely soft in touch scarf, that is additionally wrapped around a paper board and packed in a foil pouch;
- There is a beautiful box, that you need to fold and you can put the scarf into it;
- Beautiful Chinese knot of an outstanding quality, that is wrapped around a pretty paper board and additionally packed in a foil;
- A box for the knot, of a same style like the first one, just made of a thick glossy paper, that you also need to unfold and put the knot inside;
- A beautiful, red gift pouch, a high quality one, similar like you get from expensive chocolate stores;

This all comes packed in a zippered bag. Its not a heavy duty scarf, but I would say medium thickness. Its definitely warm if you wear it under a coat/jacket, and very fashionable. It will match greatly with my red heels. The scarf is nicer in touch than you can imagine. I am very impressed with this product. I feel like its a lucky scarf and all I can think of right now is that I want a cookie with a wish. I decided to post pictures with all the things this product comes with, they so deserve it.

I received a sample for the review, but you can see on my profile, that I don't rate all products five stars and give any rating the products deserve.
